    data: |
      SELECT ALL col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN NULL AND col1 * - 55 * - + CAST ( NULL AS INTEGER ) * CAST ( + - 41 AS INTEGER );
  - name: tab2

outputs:
  - name: q10717.out
    data: |
